import React, {Component} from 'react';
import { Route } from "react-router-dom";

import Dashboard from '../dashboard/Dashboard';
import Ecommerce_Dashboard from '../ecommerce/Dashboard';
import Ecommerce_Orders from '../ecommerce/Ecommerce_orders';
// import Ecommerce_Orders from '.../Ecommerce_orders';



export default class Content extends Component {

    render(){

        return (

            <React.Fragment>
                {__dirname}
                <Route exact path="/" component={Dashboard}/>
                <Route path="/ecommerce/dashboard" component={Ecommerce_Dashboard} />
                <Route path="/ecommerce/ecommerce_orders" component={Ecommerce_Orders} />
            </React.Fragment>
        )
    }
}
